package main

import (
	"github.com/gin-gonic/gin"
	"net/http"
	"time"
)

var period = 100

func RunBeaconServer() {
	router := gin.Default()
	router.GET("/eth/v1/beacon/light_client/bootstrap/:slot", func(c *gin.Context) {
		time.Sleep(3 * time.Second)
		c.Data(http.StatusOK, "application/json", []byte(bootstrapBody))

	})
	router.GET("/eth/v1/beacon/headers/:root", func(c *gin.Context) {
		time.Sleep(3 * time.Second)
		c.Data(http.StatusOK, "application/json", []byte(headersBody))
	})
	router.GET("/eth/v1/beacon/headers/finalized", func(c *gin.Context) {
		time.Sleep(3 * time.Second)
		c.Data(http.StatusOK, "application/json", []byte(finalizedBody))
	})
	router.GET("/eth/v1/beacon/light_client/updates", func(c *gin.Context) {
		time.Sleep(3 * time.Second)
		c.Data(http.StatusOK, "application/json", []byte(updatesBody))
	})
	//-----------------------
	router.POST("/", func(c *gin.Context) {
		var req RPCRequest
		err := c.BindJSON(&req)
		if err != nil {
			c.JSON(http.StatusBadRequest, gin.H{"error": err.Error()})
			return
		}
		switch req.Method {
		case "getblockcount":
			c.Data(http.StatusOK, "application/json", []byte(btcBlockCount))
		case "getblockhash":
			c.Data(http.StatusOK, "application/json", []byte(btcBlockHash))
		case "getblock":
			c.Data(http.StatusOK, "application/json", []byte(btcBlockBody))
		case "gettransaction":
			c.Data(http.StatusOK, "application/json", []byte(btcTxBody))
		case "eth_blockNumber":
			c.Data(http.StatusOK, "application/json", []byte(ethBlockNumberBody))
		case "eth_getBlockByNumber":
			c.Data(http.StatusOK, "application/json", []byte(ethBlockBody))
		case "eth_getLogs":
			c.Data(http.StatusOK, "application/json", []byte(ethLogsBody))
		default:

		}

	})

	//---------------------
	err := router.Run(":8980")
	if err != nil {
		panic(err)
	}

}

